import React from "react";
import { FaCoins } from "react-icons/fa";
import { Link } from "react-router-dom";
import "./Navbar.css";

const Navbar = () => {
  return (
    <div className="nav">
      <Link to="/">
        <div className="navbar">
          <FaCoins className="icon" />
          <h1>
            Coin <span className="purple">Search</span>
          </h1>
        </div>
      </Link>
    </div>
  );
};

export default Navbar;
